    "Toxicity tests and sediment chemistry at Site 9 (Neptune Drive Disposal Site)
    - U.S. Naval Air Station, Brunswick, Maine",nt"tracking_summary": {ntt"total":
    6,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:48:55.281052",nt"name": "toxicity-tests-and-sediment-chemistry-at-site-9-neptune-drive-disposal-site-u-s-naval-air-",nt"isopen":
    false,nt"url": null,nt"notes": "During a remedial investigation of the
    U.S. Naval Air Station Superfund Site in Brunswick, Maine (NASB), elevated concentrations
    of total polycyclic aromatic hydrocarbons (max. 383 mg/Kg) were found in the sediments
    of an unnamed stream that receives stormwater runoff from the Neptune Drive Disposal
    Site (Site 9), developed areas, and the flightline. To assess the potential risk
    of these contaminated sediments to aquatic organisms, the U.S. Environmental Protection
    Agency requested that the U.S. Fish and Wildlife Service conduct a contaminant study
    in the unnamed stream. The purposes of the study were: 1) to determine the concentrations
    of polycyclic aromatic hydrocarbons (PAHs) and other environmental contaminants
    in sediments of an unnamed stream near Site 9, and 2) to determine if the chemical
    constituents within the sediments were toxic to two test organisms, Hyalella azteca
    and Chironomus tentans.",nt"license_title": "License Not Specified",nt"extras":
